INSERT INTO `product` VALUES (1,'Rincoe Manto Aio Plus 80w','Manto AIO Plus là cái tên kế thừa sự thành công của sản phẩm Manto AIO từng làm mưa làm gió trên thị trường pod system Việt Nam. Ở phiên bản lần này, Rincoe đã thay đổi khá nhiều về ngoại hình cũng như cải tiến đôi chút về hiệu suất hoạt động. Điều này giúp Manto AIO Plus mang lại trải nghiệm vaping tốt hơn những sản phẩm Manto trước đấy',2,_binary '',50,_binary '',80),(2,'Yogi Orchards Apple 100ml','Yogi Orchards là thương hiệu tinh dầu vape freebase hoàn toàn mới với hương vị vô cùng tuyệt hảo, series các vị hoa quả lạnh đặc sắc và hương vị chủ đạo là táo đỏ, cuốn hút trên từng hơi vape. Khi sử dụng Yogi Orchards chúng ta như đang đứng giữa khu vườn cây ăn trái với những hương vị vô cùng ngọt ngào, nicotine với hàm lượng 3mg chuẩn Mỹ cùng với 100ml tinh dầu freebase độc quyền cho bạn trải nghiệm đỉnh cao nhất từ đầu đến cuối.',1,_binary '',50,_binary '',30),(3,'Coil Mesh Avocado 40w','Coils Avocado 40w kit hoàn toàn mới đến từ Avocado tích hợp công nghệ mesh coil độc quyền chất lượng cao cho trải nghiệm hút MTL/DTL cực ngon, siêu bền bỉ lên đến 7-10 ngày sử dụng, hương vị tuyệt vời và ni đậm đà',3,_binary '',50,_binary '',7),(4,'Sweet 21 Vape Napoleon 100ml','Sweet 21 Napoleon 100ml là dòng tinh dầu freebase vị ngậy mixed mới nhất 2022. Với những hương vị tuyệt hảo như chocolate, mocha, machiato… đã được mix trộn hoàn hảo với thuốc lá truyền thống, nicotine êm ái chuẩn Mỹ mang lại cho bạn trải nghiệm vô cùng mới lạ, ngọt ngào đến giọt cuối cùng.',1,_binary '',50,_binary '',30),(5,'OXVA Origin 2 Kit 80w','OXVA Origin 2 là sản phẩm thế hệ mới của seri Origin Aio và cũng là sản phẩm mới nhất trong năm 2022 của nhà OXVA với thiết kế độ phát bắt mắt và rất thời thượng. Với việc sử dung pin rời 18650 cùng công xuất đốt 80w thì Origin 2 có thể sử dụng cả hai loại tinh dầu Saltni và Freebase một cách trơn chu hoàn hảo cùng hệ thống Uicoil mesh độc quyền của OXVA',2,_binary '',50,_binary '',85),(6,'Drag X PnP-X kit 80w','Drag X PnP-X kit 80w với phong cách mạnh mẽ của các chiến binh La Mã cổ điển với những đường nét cực kỳ tinh tế và sắc sảo. Thân máy được chế tác từ thép cao cấp phủ bóng kết hợp với phần thân từ da in 3D nổi cao cấp. Sử dụng pin dời 18650 (không theo kèm) cùng công suất đốt 80w Drag X PnP kit là một trong những sản phẩm siêu khói có thể chơi được rất tốt cả 2 dòng tinh dầu Freebase và Saltni.',2,_binary '',50,_binary '',65),(19,'ASPIRE CYBER S KIT','Cyber S thuộc dòng pod mod Cyber lại đánh dấu thêm một dấu mốc đột phá trong thiết kế của Aspire. Kiểu dáng thiết kế trong suốt cùng hình dáng nhỏ gọn phô bày tất cả ưu điểm của Cyber S về cả diện mạo lẫn chất lượng sử dụng. Là dòng máy mới nhất do Aspire thiết kế và phát triển, diện mạo của Cyber S được thiết kế theo phong cách Cyberpunk vô cùng hiện đại và bắt mắt. Thân máy được làm theo lối xuyên thấu trong suốt buộc Aspire phải nâng tầm cuộc chơi để phô bày cho các vaper những chi tiết được lắp ráp và sắp xếp tỉ mỉ không tì vết. Dáng máy dạng pen nhỏ gọn, nằm vừa khít trong tay với bề mặt được gia công nhẵn bóng khiến Cyber S không chỉ bắt mắt mà còn cực kỳ dễ mang theo.\r\n\r\nNgoài vẻ ngoài hiện đại, hệ thống bên trong của Cyber S cũng được Aspire chăm chút tỉ mỉ để mang đến trải nghiệm dùng tốt nhất cho bạn. Theo đúng tiêu chí của Aspire, Cyber S hướng tới mọi vaper, từ người mới đến lâu năm. Bạn có thể dễ dàng đổi từ chế độ auto draw (cảm biến) sang sử dụng nút bấm chỉ bằng cách ấn nhanh ba lần nút công tắc trên thân máy.',2,_binary '',50,_binary '',55),(20,'UWELL CALIBURN A3 POD KIT','Uwell Caliburn A3 được thiết kế theo phong cách truyền thống của dòng vape pen, thân dáng dài thon gọn với độ dày vừa phải có thể nằm gọn trong nắm tay người dùng. Bề mặt pod mod được gia công trơn nhẵn, mượt mà với phần nút bấm khắc vân tròn được xếp gọn ngay tầm tay bấm. Để hợp với tông truyền thống, bảng màu của A3 cũng rất đơn giản, dễ lựa chọn với 6 màu basic có thể hòa hợp với hầu hết các phong cách của vaper.\r\n\r\n \r\n\r\nUwell Caliburn A3 Pod Kit\r\n\r\n \r\n\r\n \r\n\r\nĐèn LED được đặt dưới cùng với lớp vỏ ngoài giúp ánh đèn tỏa ra hai bên cực dễ theo dõi. Ba màu đèn sẽ tương tác với người dùng và phản ánh tình trạng hoạt động và dung lượng pin còn lại.',2,_binary '',50,_binary '',50),(21,'UWELL CALIBURN A3/AK3 CARTRIDGE','Pod thay cho Uwell Caliburn A3 và AK3 có dung tích 2ml và Mesh Coil 1.0ohm. Phần pod thay của Uwell Caliburn A3 và AK3 được thiết kế cải tiến với công nghệ PRO-FOCS cho hương vị tuyệt hảo. Pod có dung tích 2ml và sử dụng coil liền Mesh 1.0ohm. Lỗ châm được để bên dưới driptip cùng van một chiều giúp thao tác châm tinh dầu nhanh gọn và sạch sẽ.',3,_binary '',50,_binary '',8),(22,'ASPIRE TSX CARTRIDGE','Hệ pod TSX được thiết kế riêng cho dòng máy Cyber của Aspire với dung tích 3ml cùng hai mức điện trở khác nhau.\r\n\r\n\r\nĐược thiết kế riêng cho dòng máy Cyber của Aspire gồm Cyber S và Cyber X. Pod của TSX sử dụng sidefill thuận tiện, chống leak với dung tích 3ml cùng hệ Mesh coil giúp lên hương vị chuẩn chỉnh. \r\n\r\nBạn có thể lựa chọn giữa hai điện trở mesh 0.8ohm hoặc mesh 1.0ohm cho phù hợp với loại tinh dầu mà bạn chọn. Số lượng: 2 pod/pack',3,_binary '',50,_binary '',10),(23,'MINUTE MAN FRUIT ICE ALOE (100ML)(NHA ĐAM LẠNH)','Aloe Ice của Minute Man mang đến hương vị thanh nhẹ, dễ chịu của nha đam lạnh.\r\n\r\n\r\n\r\nThật khó để tìm ra sự đột phá giữa hàng ngàn chai tinh dầu hiện nay. Nếu bạn đang mắc kẹt lẩn quẩn giữa những trái cây quen thuộc như cam, xoài, dâu …vv..vv thì MinuteMan đã giúp bạn giải quyết vấn đề nan giải này. Hãng mang lại một hương vị vô cùng lạ lẫm là Nha Đam. Chúng ta có thể thấy Nha Đam ứng dụng cho nhiều sản phẩm, món ăn nhưng với tín đồ vaping thì đây là một sự mới mẻ.\r\n\r\nĐể thăng hoa hơn hãng đã pha một chút dưa hấu vào cùng Nha Đam. Đặc trưng của dòng dưa hấu này khi sử dụng các hãng khác ta sẽ cảm giác một chút khô nhẹ phần hậu vị, đây là sở thích của xứ trời Âu nhưng có vẻ lại không phù hợp đối với anh em vaper châu Á. Để làm hài lòng khách hàng trên khắp thế giới, MinuteMan đã cải biên lại 1 chút với vị dưa hấu. Dưa hấu trong sản phẩm Aloe Ice có độ thơm lan toả, vị dưa hấu ngập tràn khoang miệng nhưng vô cùng êm ái dễ chịu.\r\n\r\nHương vị vô cùng mới mẻ, điểm ấn tượng mạnh là hương thơm ngào ngạt khi bạn vừa mở sản phẩm. Độ ngọt của line này được đi theo chuẩn mực Châu Âu nên sẽ khá ít ngọt, bạn cảm nhận sẽ là một độ ngọt thanh mát thoang thoảng nhẹ nhàng, phù hợp cho bạn nào khó chịu vì độ ngọt gắt từ tinh dầu.',1,_binary '',50,_binary '',38);
INSERT INTO `product` VALUES (24,'DINNER LADY GB STRAWBERRY WATERMELON SALT NIC (30ML)(DÂU DƯA HẤU)','Strawberry Watermenlon của Dinner Lady là tổ hợp hương hoa quả từ dâu tây và dưa hấu nhẹ nhàng, dễ chịu.\r\n\r\n\r\n\r\nDâu dưa hấu luôn là mixture thân thiện và dịu dàng nhất trong các mix hoa quả có trên thị trường, với 2 hương vị bổ trợ lẫn nhau: dưa hấu mang đến độ tinh khiết và thanh mát, dâu mang lại nét ngọt ngào, đằm thắm.\r\n\r\n \r\n\r\nDinner Lady GB Strawberry Watermelon Salt Nic\r\n\r\n \r\n\r\nĐiều lạ lẫm là trong tổ hợp của Strawberry Watermelon, Dinner đã lấy hương vị dưa hấu làm chủ đạo, với độ ngọt vô cùng nhẹ nhàng và độ ẩm cao, chỉ điểm thêm hương dâu tây, thêm một thìa vị ngọt - kết quả mang lại là 1 hơi vape rất giống với 1 ly nước ép hoa quả: rất thanh mát, ẩm ướt, ngọt nhẹ, và thơm lừng cả dãy phố 1 mùi hương dâu tây thật dễ chịu.',1,_binary '',50,_binary '',35);
